George W. Bush: The 9-11 Interview

Sociopolitical Documentary with no narration published by National Geographic in 2011 - English language


Information
------------------------------

National Geographic Channel presents George W. Bush: The 9/11 Interview, a world premiere documentary offering exclusive first-person insight from the former president on what he was thinking and feeling and what drove the real-time, life-or-death decisions he faced in response to the most lethal terrorist attacks ever on U.S. soil.

